PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `core_store` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `key` varchar(255) null, `value` longtext null, `type` varchar(255) null, `environment` varchar(255) null, `tag` varchar(255) null);
CREATE TABLE `strapi_administrator` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `username` varchar(255) not null, `email` varchar(255) not null, `password` varchar(255) not null, `resetPasswordToken` varchar(255) null, `blocked` boolean null);
CREATE TABLE `users-permissions_permission` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `type` varchar(255) not null, `controller` varchar(255) not null, `action` varchar(255) not null, `enabled` boolean not null, `policy` varchar(255) null, `role` integer null);
CREATE TABLE `users-permissions_role` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `name` varchar(255) not null, `description` varchar(255) null, `type` varchar(255) null);
CREATE TABLE `upload_file` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `name` varchar(255) not null, `hash` varchar(255) not null, `sha256` varchar(255) null, `ext` varchar(255) null, `mime` varchar(255) not null, `size` varchar(255) not null, `url` varchar(255) not null, `provider` varchar(255) not null, `provider_metadata` longtext null, `created_at` timestamp DEFAULT CURRENT_TIMESTAMP null, `updated_at` timestamp DEFAULT CURRENT_TIMESTAMP null);
CREATE TABLE `upload_file_morph` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `upload_file_id` int null, `related_id` int null, `related_type` longtext null, `field` longtext null);
CREATE TABLE `dialogues` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `title` varchar(255) not null, `author` integer null, `text` longtext not null, `starter` varchar(255) null, `created_at` timestamp DEFAULT CURRENT_TIMESTAMP null, `updated_at` timestamp DEFAULT CURRENT_TIMESTAMP null);
CREATE TABLE `users-permissions_user` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `username` varchar(255) not null, `email` varchar(255) not null, `provider` varchar(255) null, `password` varchar(255) null, `resetPasswordToken` varchar(255) null, `confirmed` boolean null, `blocked` boolean null, `role` integer null, `created_at` timestamp DEFAULT CURRENT_TIMESTAMP null, `updated_at` timestamp DEFAULT CURRENT_TIMESTAMP null);
CREATE TABLE `visuals` (`id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, `name` varchar(255) not null, `type` varchar(255) null, `mediatype` varchar(255) null, `created_at` timestamp DEFAULT CURRENT_TIMESTAMP null, `updated_at` timestamp DEFAULT CURRENT_TIMESTAMP null);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX `strapi_administrator_username_unique` on `strapi_administrator` (`username`);
CREATE UNIQUE INDEX `users-permissions_role_type_unique` on `users-permissions_role` (`type`);
CREATE UNIQUE INDEX `users-permissions_user_username_unique` on `users-permissions_user` (`username`);
CREATE UNIQUE INDEX `visuals_name_unique` on `visuals` (`name`);
COMMIT;
